%% === 第二部分：动力学可视化 (质量与惯量) ===
% 注意：这里的G矩阵是对角阵，意味着提供的惯量是基于Principal Axes的，且假设CoM在坐标系原点。
% 如果CoM不在原点，G矩阵通常不是对角阵。为了可视化，我们假设 Frame Origin = CoM。

figure('Name', 'UR5 Dynamics Parameters', 'Color', [1 1 1]); %[output:213df4dd]
hold on; grid on; axis equal; %[output:213df4dd]
xlabel('X (m)'); ylabel('Y (m)'); zlabel('Z (m)'); %[output:213df4dd]
